resources.string:
1. जब परिवार के सदस्य मंच पर अधिक समय व्यतीत करते हैं तो परिवार उच्च स्थान पर होता है। उदाहरण के लिए, दैनिक लॉगिन, कमरे में रहने की अवधि, उपहार देना।
 2. परिवार के सदस्य गतिविधि अंक कैसे अर्जित करें:
 20 अंक दैनिक लॉगिन/मंबर के लिए अर्जित;
 प्रत्येक सदस्य प्रति दिन 50 अंक अर्जित करने के लिए 10 मिनट के लिए किसी भी कमरे में रहता है;
 अन्य उपयोगकर्ताओं को उपहार भेजें, 1 हीरा = 1 गतिविधि बिंदु, 10 बीन्स = 1 गतिविधि बिंदु।
 3.साप्ताहिक सूची और मासिक सूची में कुल पारिवारिक गतिविधि शामिल है, और इसे साप्ताहिक या मासिक रूप से अपडेट किया जाएगा।
